const currencyLoaded = (currency, v2) => {
	return {
		type: 'CURRENCY_LOADED',
		payload: currency,
		payload2: v2
	};
};

const convertibleCurrency = (code, value, v2) => {
	return {
		type: 'CONVERTIBLE_CURRENCY',
		code,
		value,
		payload2: v2
	};
}

const newValue2 = (val2, v2) => {
	return {
		type: 'VAL_2',
		payload: val2,
		payload2: v2
	};
};

export {
	currencyLoaded,
	convertibleCurrency,
	newValue2
};
